          />
          <div>
            <strong>kimdim/doces</strong>
            <p>
              Lorem ipsum dolor sit, amet consectetur adipisicing elit.
              Voluptatem, officia!
            </p>
          </div>

          <FiChevronRight size={20} />
        </a>
